import React from 'react';

const ProfessionalPlayersList = (props) =>{
	return(
		<div>
			<h2>Name: {props.name}{key}</h2>
			<h3>Age: {props.age}{key}</h3>
			<h3>Grand Slams: {props.grandSlams}{key}</h3>
		</div>
	)
}

export default ProfessionalPlayersList;
